import React, { Component } from "react";
import "./estilos.css";

import 'bootstrap/dist/css/bootstrap.min.css';



//https://www.npmjs.com/package/country-flags-svg

class Bandeiras extends Component{
    constructor(props){
        super(props)
    }

    render(){
       
        return(
            <section className='cb'>
            <ul>
                {this.props.bandeirasInicio.map((b,index)=>{
                    return(
                        <li key={'band'+index}>
                            <img src={b.bandeira} width="50px" alt={b.nome}></img>
                            <p>{b.nome}</p>
                        </li>
                    )
                })}
            </ul>
            </section>
        )
    }
}

export default Bandeiras;
